import React from 'react';
import { Component } from 'react';
import styled from 'styled-components';

const Basic = styled.div`
  height : 50px;
  width : 100px;
  background-color : rgb(52, 58 , 64);

`

class Nav extends Component {
	render(){
		return(
			<Basic></Basic>
		);
	};

}

export default Nav;
